import React from "react";
import cityweather from './city-weather.json';


function CityList(){
    console.log(cityweather);

    return (
        <div>
              {cityweather.map(x=>{

                    <City name={x}/>

              })}

        </div>
    )
}

function City({name}){
    return(
        <div>
            <h2>{name}</h2>
        </div>
    )

}

export default CityList;
